import React from 'react';
import Slide from './Slide.js';

const SlideShow = (props) => {
    const content = props.data
    const contentMap = content.map(slide => {
        return(<Slide 
            data={slide}
            key={slide.id}
        />)
    })

    return (<div>This is a test</div>)
}

export default SlideShow
